    def submitbutton(self):
        gate = self.gate.currentText()
        combo1 = int(self.c1.currentText())
        combo2 = int(self.c2.currentText())
        result = -1
        if gate == "AND":
            result = combo1 & combo2
        elif gate == "OR":
            result = combo1 | combo2
        elif gate == 'XOR':
            result = combo1 ^ combo2

        self.label_5.setText(f'X {gate} Y = {result}')
        self.label_5.adjustSize()


